import React from "react";
import { Navbar, Button, Link } from "@nextui-org/react";
import { Layout } from "./Navbar/Layout.js";
import { AcmeLogo } from "./Navbar/AcmeLogo.js";
import { useTheme, Text } from '@nextui-org/react';
import { Card, Grid, Row } from "@nextui-org/react";



export default function App() {

  const [variant] = React.useState("sticky");

  const MockItem = ({ text }) => {
    return (
      <Card css={{ h: "$24", $$cardColor: '$colors$primary' }}>
        <Card.Body>
          <Text h6 size={15} color="white" css={{ mt: 0 }}>
            {text}
          </Text>
        </Card.Body>
      </Card>
    );
  };

  return (
    <Layout>
      <Navbar variant={variant} style = {{fontFamily: "Inter"}}>
        <Navbar.Brand>
          <Text b color="inherit" hideIn="xs">
            osiris.cc
          </Text>
        </Navbar.Brand>
        <Navbar.Content hideIn="xs">
          <Navbar.Link href="#">Home</Navbar.Link>
          <Navbar.Link isActive href="#">Features</Navbar.Link>
          <Navbar.Link href="#">Purchase</Navbar.Link>
        </Navbar.Content>
        <Navbar.Content>
          <Navbar.Item>
          <Button color="primary" auto>Dashboard</Button>

        </Navbar.Item>
        </Navbar.Content>
      </Navbar>
    <div style = {{marginLeft: "275px"}}>
    <>
      <Text size="56px" style = {{marginTop: "220px", fontFamily: "Inter", fontWeight: "bold",  }} >Greatest Streamable</Text>
      <div class="wrapperz">
       <div class="wordsz">
           <span className = "a" style = {{backgroundImage: "linear-gradient(180deg, #5EA2EF 25%, #0072F5 100%)", WebkitBackgroundClip: "text", WebkitTextFillColor: "transparent"}}>Exclusive features</span>
           <span className = "a">Bypassed every Anti-Cheat</span>
           <span className = "a">External Client</span>
           <span className = "a">Bypassed every Anti-Cheat</span>
           <span className = "a" style = {{backgroundImage: "linear-gradient(180deg, #5EA2EF 25%, #0072F5 100%)", WebkitBackgroundClip: "text", WebkitTextFillColor: "transparent"}}>Exclusive features</span>
       </div>
      </div>
      <Text size="20px" color="#AAAAAA" style = {{fontFamily: "Inter", fontWeight: "semibold"}} >Prioritizing your security and legitness, we're indisputably the greatest streamable.</Text>
    </>
    <Button shadow color="gradient" style = {{marginTop: "8px", fontFamily: "Inter"}}>Purchase</Button>
    </div>
    <div style = {{marginTop: "260px"}}>

    </div>
    </Layout>
  );
}
